import { useEffect, useState } from "react"

const data = [
       "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQuPrIsT8ZtXX8wJ6lOE1wo0GDVGTPXXWrRSSt7EgyS27tFEsvnXBe5Of8&s",
         "data:image/jpeg;base64,",
         "data:image/jpeg;base64,",
         "data:image/jpeg;base64,",
         "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTDGBD8zvHZUseJfQ6mij5UjRX20bGUweV-vkNJEATXJoqFRUVKFnuI2fg&s",
]  
const Slider = ()=>{
const [count , setcount] = useState(0);
if(count<0){
    setcount(4)
}
else if (count>=5){
    setcount(0)
}
const change = ()=>{
    setcount(count+1)
    
}
const previous = ()=>{
    setcount(count-1)
    
}


useEffect(()=>{
    const  clearTime = setTimeout(() => {
        change();
    }, 2000);
    return ()=> clearTimeout(clearTime)
})
    return(<>
<div className="flex items-center justify-center">
<button onClick={previous} className="px-6 py-3 bg-blue-500 text-white
 font-semibold rounded-lg shadow-lg hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-400">previous</button>

 <img  src={ data[count] } className="w-1/2 h-64 hover:w-36 hover:h-24  border-r-4 to-black border-solid m-2  rounded-2xl"/> 
 
 <button onClick={change} className="px-6 py-3 bg-blue-500 text-white font-semibold 
 rounded-lg shadow-lg hover:bg-blue-600 focus:outline-none 
 focus:ring-2 focus:ring-blue-400"> NEXT</button>  
</div>
        </>)
}    
export default  Slider;